schemaDefinition: "create or replace dynamic table DYNAMIC_TABLE(\n\tPROCESSED,\n\t\
  RECORD_COUNT,\n\tLAST_CREATED,\n\tFIRST_CREATED\n) target_lag = '30 days' refresh_mode\
  \ = AUTO initialize = ON_CREATE warehouse = COMPUTE_WH\n as\nSELECT\n    processed,\n\
  \    COUNT(*) as record_count,\n    MAX(created_at) as last_created,\n    MIN(created_at)\
  \ as first_created\nFROM transient_table\nGROUP BY processed;"
